DROP TABLE IF EXISTS EmploymentEducation;
CREATE TABLE EmploymentEducation(
   EmploymentEducationID INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,ProjectEntryID        INTEGER  NOT NULL
  ,PersonalID            INTEGER  NOT NULL
  ,InformationDate       DATE  NOT NULL
  ,LastGradeCompleted    VARCHAR(30)
  ,SchoolStatus          VARCHAR(30)
  ,Employed              INTEGER  NOT NULL
  ,EmploymentType        VARCHAR(30)
  ,NotEmployedReason     VARCHAR(30)
  ,DataCollectionStage   INTEGER  NOT NULL
  ,DateCreated           VARCHAR(14) NOT NULL
  ,DateUpdated           VARCHAR(14) NOT NULL
  ,UserID                INTEGER  NOT NULL
  ,DateDeleted           VARCHAR(30)
  ,ExportID              INTEGER  NOT NULL
);
